import './App.css';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";
import Inicio from './components/Inicio/Inicio.js';
import Agregar from './components/Agregar/Agregar.js';
import Buscar from './components/Buscar/Buscar.js';

function App() {
  return (
    <Router>
      <div>
        <Routes>
      <Route path='/'>
        <Inicio />
      </Route>
      <Route path='/agregar'>
        <Agregar />
      </Route>
      <Route path='/'>
        <Buscar />
      </Route>
      </Routes>
      </div>
    </Router>
  );
}

export default App;
